import React, { Fragment, useState } from "react";
import Video from "./VideoItem";

const Videos = (props) => {
  const [videosList, setVideoLists] = useState(props.items);
  console.log(props);

  return (
    <div>
      {videosList.map((video) => {
        return <Video key={video.id} source={video} />;
      })}
    </div>
  );
};

export default Videos;
